package io.sfer.xxx.Model;

import lombok.*;

import javax.persistence.*;

@Entity
@Table(name = "productcateg")
@Data
@NoArgsConstructor
@AllArgsConstructor
@Getter
@Setter

public class ProductCategory {
    @Id
    @GeneratedValue(strategy = GenerationType.IDENTITY)
    Integer id;
}
